import React from "react";
import StreamCard from "./StreamCard";

class Streams extends React.Component {
  renderList() {
    const girls = [
      "gabi",
      "thaiga",
      "nittmv",
      "diovanakoni",
      "lilypichu",
      "xchocobars",
      "kurolily",
      "itssky",
      "chloelock",
      "nickitaylor",
      "scr3amqueen",
      "gtbae",
      "fuslie",
      "igumdrop",
      "cxlibri",
      "sxywu",
      "nerites"
    ];
    return girls.map(girl => {
      return <StreamCard channel={girl} />;
    });
  }
  render() {
    return (
      <div className="streamsList">
        <h2>Streams</h2>
        {this.renderList()}
      </div>
    );
  }
}
export default Streams;
